BEGIN TRANSACTION;
CREATE TABLE airportcodes (
	code VARCHAR(4) NOT NULL, 
	location VARCHAR(150) NOT NULL, 
	longitude FLOAT, 
	latitude FLOAT, 
	PRIMARY KEY (code)
);
CREATE TABLE campsites (
	id INTEGER NOT NULL, 
	name VARCHAR(150) NOT NULL, 
	longitude FLOAT NOT NULL, 
	latitude FLOAT NOT NULL, 
	phone VARCHAR(150), 
	dates VARCHAR(150), 
	comments VARCHAR(550), 
	campsites VARCHAR(50), 
	PRIMARY KEY (id)
);
COMMIT;
